import React from 'react';
import { useNavigate } from 'react-router-dom';
import './PersonalizeExperience.css';

function PersonalizeExperience() {
  const navigate = useNavigate();

  const handleSectionClick = (path) => {
    navigate(path);
  };

  return (
    <div className="personalize-container">
      <h1>Personalize Your Experience</h1>
      <div className="section" onClick={() => handleSectionClick('/gender')}>
        Getting to Know You
      </div>
      <div className="section" onClick={() => handleSectionClick('/dietary')}>
        Dietary Habits
      </div>
      <div className="section" onClick={() => handleSectionClick('/medical')}>
        Medical Conditions
      </div>
      <div className="section" onClick={() => handleSectionClick('/goals')}>
        Goals
      </div>
    </div>
  );
}

export default PersonalizeExperience;
